import styled from 'styled-components';
import Layout from '../components/Layout';
 
const Contacto = () => {
 
    return ( 
        <>
            <Layout title="La Rioja Turismo - Contacto">
                <h1> Contacto</h1>
            </Layout>
        </>
     );
}
 
export default Contacto;
